INSERT INTO public.contents (id, file_name, caption, file_size, file_url, uploaded_at, assigned_profile_id, scheduled_at, scheduled_slot_id, status, removed_at, removed_from_profile_id, user_id, description, platform, uploadpost_request_id, is_locked, webhook_response, retry_count, next_retry_at, webhook_call_id) VALUES ('30b7b017-eceb-4c60-a673-22c0a09d1844', 'video.mp4', 'Prabowo kumpulkan menteri di rumah! Team building atau sandiwara politik?', 5033873, 'cdbea23e-6767-4722-9319-896fcb6dc057/1769056209770-6qch3u.mp4', '2026-01-22 04:30:10.130166+00', 'e19405bf-1f80-4107-af89-084f9ccc5608', '2026-01-25 09:00:00+00', '09e0385d-4d7c-4fa9-8c7d-7bb6b8323d25', 'failed', NULL, NULL, 'cdbea23e-6767-4722-9319-896fcb6dc057', 'Tanggal 6 Januari 2026, Presiden Prabowo Subianto membuat heboh dengan menggelar ''Briefing Awal Tahun'' yang sangat tidak biasa: mengumpulkan semua menteri dan kepala lembaga di kediaman pribadinya di Hambalang. Ini bukan sidang formal, melainkan retreat santai untuk evaluasi jujur setahun pemerintahan, jauh dari birokrasi istana. Prabowo mendesak peningkatan kinerja, terutama di sektor penciptaan lapangan kerja dan infrastruktur perikanan. Pendekatan kepemimpinan ini viral dan memicu perdebatan: apakah ini inovasi kepemimpinan yang segar (ala team-building korporat) atau hanya sandiwara politik untuk memperketat kendali atas ''Kabinet Merah Putih''? Simbolisme ''kabinet dapur'' ini berhasil mencuri perhatian publik. Menurut Anda, apakah retreat ini terobosan atau gimmick? Tulis pendapat Anda di komentar!', 'tiktok', NULL, false, '{"raw":"<html>\r\n<head><title>504 Gateway Time-out</title></head>\r\n<body>\r\n<center><h1>504 Gateway Time-out</h1></center>\r\n<hr><center>nginx/1.29.3</center>\r\n</body>\r\n</html>\r\n"}'::jsonb, 0, NULL, NULL);
INSERT INTO public.contents (id, file_name, caption, file_size, file_url, uploaded_at, assigned_profile_id, scheduled_at, scheduled_slot_id, status, removed_at, removed_from_profile_id, user_id, description, platform, uploadpost_request_id, is_locked, webhook_response, retry_count, next_retry_at, webhook_call_id) VALUES ('59b901aa-a1e9-4236-b077-3399fce006b5', 'video.mp4', 'üö® AS keluar dari 66 organisasi global sekaligus! Unilateralisme agresif AS dimulai?', 8202452, 'cdbea23e-6767-4722-9319-896fcb6dc057/1768373283674-pn5w0e.mp4', '2026-01-14 06:50:30.05066+00', 'e19405bf-1f80-4107-af89-084f9ccc5608', NULL, NULL, 'removed', '2026-01-14 08:00:00.179+00', 'e19405bf-1f80-4107-af89-084f9ccc5608', 'cdbea23e-6767-4722-9319-896fcb6dc057', 'Pada 7 Januari 2026, Presiden Trump menandatangani memorandum yang menarik Amerika Serikat dari 66 organisasi internasional sekaligus (35 non-PBB dan 31 entitas PBB). Keputusan dramatis ini, yang oleh Gedung Putih disebut sebagai langkah melawan ''agenda globalis'', menargetkan badan-badan penting termasuk Panel Iklim PBB (IPCC/UNFCCC) dan organisasi bantuan kemanusiaan. Analis memperingatkan bahwa penarikan ini akan sangat menghambat upaya global melawan perubahan iklim dan memutus dukungan vital bagi jutaan korban bencana dan pengungsi. Apakah langkah ini memperkuat Amerika atau justru mengisolasi diri? Diskusikan di komentar!', NULL, NULL, false, '{"results":{"youtube":{"changes":[],"post_id":"fxac9Legshs","prevalidation_metadata":{"audio_codec":"aac","container":"mov,mp4,m4a,3gp,3g2,mj2","duration":100.711,"fps":24,"height":1280,"video_codec":"h264","width":720},"success":true,"url":"https://www.youtube.com/watch?v=fxac9Legshs","video_was_transcoded":false}},"success":true,"usage":{"count":61,"last_reset":"2026-01-05T01:51:32.043486","limit":-1}}'::jsonb, 0, NULL, NULL);
