INSERT INTO public.contents (id, file_name, caption, file_size, file_url, uploaded_at, assigned_profile_id, scheduled_at, scheduled_slot_id, status, removed_at, removed_from_profile_id, user_id, description, platform, uploadpost_request_id, is_locked, webhook_response, retry_count, next_retry_at, webhook_call_id) VALUES ('09c53a2f-e35b-4dba-ba73-01062fd902f8', 'video.mp4', 'Formula Damai Paris: 30 Negara Siap Kirim Pasukan! Akhir Perang Sudah Dekat?', 8316741, 'cdbea23e-6767-4722-9319-896fcb6dc057/1768379718951-rhuchm.mp4', '2026-01-14 09:06:32.007353+00', 'e19405bf-1f80-4107-af89-084f9ccc5608', NULL, NULL, 'removed', '2026-01-15 04:00:00.46+00', 'e19405bf-1f80-4107-af89-084f9ccc5608', 'cdbea23e-6767-4722-9319-896fcb6dc057', 'Paris, Januari 2026: Lebih dari 30 negara berkumpul dalam KTT ''koalisi kehendak'' untuk mencari formula mengakhiri Perang Rusia-Ukraina. Deklarasi bersama menuntut jaminan keamanan yang kuat. Macron, Zelenskyy, dan PM Starmer berkomitmen mengirim pasukan multinasional (Prancis siap mengerahkan ribuan tentara) jika gencatan senjata tercapai. Koalisi juga sepakat menggunakan teknologi canggih AS (drone, satelit) untuk memantau. Namun, isu teritorial Donbas dan tingginya kerugian Rusia tetap menjadi tantangan besar. Apakah diplomasi puluhan negara ini cukup kuat? Tulis pendapat Anda.', NULL, NULL, false, '{"results":{"youtube":{"changes":[],"post_id":"SCzQbo4JVBc","prevalidation_metadata":{"audio_codec":"aac","container":"mov,mp4,m4a,3gp,3g2,mj2","duration":111.879,"fps":24,"height":1280,"video_codec":"h264","width":720},"success":true,"url":"https://www.youtube.com/watch?v=SCzQbo4JVBc","video_was_transcoded":false}},"success":true,"usage":{"count":77,"last_reset":"2026-01-05T01:51:32.043486","limit":-1}}'::jsonb, 0, NULL, NULL);
