INSERT INTO public.contents (id, file_name, caption, file_size, file_url, uploaded_at, assigned_profile_id, scheduled_at, scheduled_slot_id, status, removed_at, removed_from_profile_id, user_id, description, platform, uploadpost_request_id, is_locked, webhook_response, retry_count, next_retry_at, webhook_call_id) VALUES ('f18504be-d0bc-451a-8c2a-ae0fa0ccd6f4', 'video.mp4', 'Eks Menteri Nadiem jadi terdakwa korupsi Rp2,18 T. Dari inspirator jadi pesakitan? #Korupsi', 8569938, 'cdbea23e-6767-4722-9319-896fcb6dc057/1768372323974-jlo9dj.mp4', '2026-01-14 06:50:40.029794+00', 'e19405bf-1f80-4107-af89-084f9ccc5608', NULL, NULL, 'removed', '2026-01-14 11:00:00.462+00', 'e19405bf-1f80-4107-af89-084f9ccc5608', 'cdbea23e-6767-4722-9319-896fcb6dc057', 'Nadiem Makarim, eks Menteri Pendidikan dan pendiri Gojek, menjalani sidang perdana di Pengadilan Tipikor sebagai terdakwa kasus korupsi pengadaan Chromebook (2019-2022). Negara merugi Rp2,18 triliun, dengan dugaan Nadiem memperkaya diri hingga Rp809 miliar. Kasus ini istimewa karena menjadi yang pertama menerapkan KUHP dan KUHAP baru yang berlaku sejak 2 Januari 2026.

