INSERT INTO public.contents (id, file_name, caption, file_size, file_url, uploaded_at, assigned_profile_id, scheduled_at, scheduled_slot_id, status, removed_at, removed_from_profile_id, user_id, description, platform, uploadpost_request_id, is_locked, webhook_response, retry_count, next_retry_at, webhook_call_id) VALUES ('c524d301-6a44-4776-adfa-24797e68aa3b', 'video.mp4', 'Ijonk BEBAS dari Penjara! Tapi... Masih diawasi? Cuti Bersyarat!', 8784402, 'cdbea23e-6767-4722-9319-896fcb6dc057/1768377221474-mcest.mp4', '2026-01-14 07:56:06.1306+00', '682155d9-1231-404e-af32-d7f52e15de69', NULL, NULL, 'removed', '2026-01-14 12:01:02.427+00', '682155d9-1231-404e-af32-d7f52e15de69', 'cdbea23e-6767-4722-9319-896fcb6dc057', 'Gosip hangat datang dari Jonathan Frizzy! Setelah menjalani masa hukuman, Ijonk dikabarkan bebas dari penjara melalui program cuti bersyarat. Namun, kebebasan ini bukan bebas penuh, Bun. Direktorat Jenderal Pemasyarakatan mengonfirmasi bahwa Ijonk masih berada di bawah pengawasan ketat Balai Pemasyarakatan (Bapas). Bagaimana kelanjutan statusnya sebagai figur publik? Apakah Ijonk akan comeback? Spill pendapat Bunda: Apakah dia pantas mendapat kesempatan kedua?', NULL, NULL, false, '{"results":{"youtube":{"changes":[],"post_id":"SG6w1dUpM8A","prevalidation_metadata":{"audio_codec":"aac","container":"mov,mp4,m4a,3gp,3g2,mj2","duration":111.627,"fps":24,"height":1280,"video_codec":"h264","width":720},"success":true,"url":"https://www.youtube.com/watch?v=SG6w1dUpM8A","video_was_transcoded":false}},"success":true,"usage":{"count":71,"last_reset":"2026-01-05T01:51:32.043486","limit":-1}}'::jsonb, 0, NULL, NULL);
