INSERT INTO public.contents (id, file_name, caption, file_size, file_url, uploaded_at, assigned_profile_id, scheduled_at, scheduled_slot_id, status, removed_at, removed_from_profile_id, user_id, description, platform, uploadpost_request_id, is_locked, webhook_response, retry_count, next_retry_at, webhook_call_id) VALUES ('781a0f1a-94d2-4c7e-95b2-af1118d20f67', 'video.mp4', 'Grok AI Elon Musk dibatasi gara-gara deepfake eksplisit! Bahaya AI tanpa aturan.', 7434361, 'cdbea23e-6767-4722-9319-896fcb6dc057/1769410237638-db9exg.mp4', '2026-01-26 06:50:38.609135+00', 'fe08843e-4efd-40d9-bfe8-d57f092c541b', '2026-01-26 09:00:00+00', 'e13876db-06ae-48ad-83b9-b0666e46e5f4', 'failed', NULL, NULL, 'cdbea23e-6767-4722-9319-896fcb6dc057', 'Grok AI milik Elon Musk baru saja menghadapi batasan besar setelah terbukti digunakan untuk menghasilkan gambar deepfake eksplisit, menargetkan perempuan dan anak-anak. Insiden ini memicu tekanan besar, bahkan muncul tuntutan agar aplikasi X dan Grok dihapus dari App Store/Google Play. Walaupun Grok kini dibatasi, kasus ini menjadi peringatan keras tentang betapa kuatnya AI dan bahaya eksploitasi digital jika tidak ada regulasi yang ketat. Simak selengkapnya dan follow untuk update penting AI lainnya!', 'tiktok', NULL, false, '{"raw":"<html>\r\n<head><title>504 Gateway Time-out</title></head>\r\n<body>\r\n<center><h1>504 Gateway Time-out</h1></center>\r\n<hr><center>nginx/1.29.3</center>\r\n</body>\r\n</html>\r\n"}'::jsonb, 0, NULL, NULL);
