INSERT INTO public.contents (id, file_name, caption, file_size, file_url, uploaded_at, assigned_profile_id, scheduled_at, scheduled_slot_id, status, removed_at, removed_from_profile_id, user_id, description, platform, uploadpost_request_id, is_locked, webhook_response, retry_count, next_retry_at, webhook_call_id) VALUES ('6e644adb-dda6-4b71-83aa-6d367d521ccd', 'video.mp4', 'Physical AI CES 2026: GenAI jadi OTAK robot di DUNIA NYATA! ü§ñüî•', 7763111, 'cdbea23e-6767-4722-9319-896fcb6dc057/1768883994346-ctpx4.mp4', '2026-01-20 04:39:57.084388+00', 'fe08843e-4efd-40d9-bfe8-d57f092c541b', NULL, NULL, 'removed', '2026-01-21 11:02:01.912+00', 'fe08843e-4efd-40d9-bfe8-d57f092c541b', 'cdbea23e-6767-4722-9319-896fcb6dc057', 'CES 2026 menyoroti tren terbesar: Physical AI. Ini adalah lompatan besar di mana GenAI dan LLM (yang biasanya kita kenal dari ChatGPT) kini menjadi otak untuk perangkat fisik, seperti robot rumah tangga dan kendaraan otonom. AI tidak lagi hanya di cloud, melainkan terintegrasi langsung ke perangkat edge, memungkinkan mesin berinteraksi dan merespons konteks di dunia nyata. Video ini membahas bagaimana interaksi kita dengan teknologi akan berubah dari mengetik/berbicara ke layar, menjadi berinteraksi langsung dengan mesin yang bertindak secara fisik.', 'instagram', NULL, false, '{"results":{"instagram":{"changes":[],"media_type":"REELS","post_id":"18053906300413981","prevalidation_metadata":{"audio_codec":"aac","container":"mov,mp4,m4a,3gp,3g2,mj2","duration":116.209,"fps":24,"height":1280,"video_codec":"h264","width":720},"success":true,"url":"https://www.instagram.com/reel/DTxTUmmjwQJ/","video_was_transcoded":false}},"success":true,"usage":{"count":167,"last_reset":"2026-01-05T01:51:32.043486","limit":-1}}'::jsonb, 0, NULL, NULL);
