INSERT INTO public.contents (id, file_name, caption, file_size, file_url, uploaded_at, assigned_profile_id, scheduled_at, scheduled_slot_id, status, removed_at, removed_from_profile_id, user_id, description, platform, uploadpost_request_id, is_locked, webhook_response, retry_count, next_retry_at, webhook_call_id) VALUES ('1ab116f4-3d54-41dc-9e1c-453ad31d735d', 'video.mp4', 'Megawati Pimpin PDIP Oposisi Kritis. Strategi efektif? #PDIP #PolitikIndonesia', 10103742, 'cdbea23e-6767-4722-9319-896fcb6dc057/1769056209483-z6srd7.mp4', '2026-01-22 04:30:10.592781+00', 'e19405bf-1f80-4107-af89-084f9ccc5608', '2026-01-25 09:00:00+00', 'f29fa603-adf7-4b77-876e-88cfacf17348', 'failed', NULL, NULL, 'cdbea23e-6767-4722-9319-896fcb6dc057', 'Rakernas I PDIP tahun 2026 menjadi panggung Megawati Soekarnoputri menegaskan arah partai. Di usia ke-53 tahun, PDIP memutuskan mengambil sikap oposisi yang kritis konstruktif terhadap pemerintahan Prabowo. Megawati menekankan pentingnya soliditas internal dan kesetiaan pada ideologi Bung Karno pasca-Pemilu 2025. Rakernas ini merumuskan program kerja hingga 2030, termasuk evaluasi Pemilu 2024 dan isu geopolitik. Pertanyaannya, apakah strategi oposisi yang ''kritis konstruktif'' ini tepat? Tulis pendapat Anda di kolom komentar!', 'instagram', NULL, false, '{"raw":"<html>\r\n<head><title>504 Gateway Time-out</title></head>\r\n<body>\r\n<center><h1>504 Gateway Time-out</h1></center>\r\n<hr><center>nginx/1.29.3</center>\r\n</body>\r\n</html>\r\n"}'::jsonb, 0, NULL, NULL);
INSERT INTO public.contents (id, file_name, caption, file_size, file_url, uploaded_at, assigned_profile_id, scheduled_at, scheduled_slot_id, status, removed_at, removed_from_profile_id, user_id, description, platform, uploadpost_request_id, is_locked, webhook_response, retry_count, next_retry_at, webhook_call_id) VALUES ('135c9a7b-ca06-42cd-9bfe-e8094b9f2499', 'video.mp4', 'Prabowo kumpulkan menteri di rumah! Team building atau sandiwara politik?', 5033873, 'cdbea23e-6767-4722-9319-896fcb6dc057/1769056210980-2gq0aa.mp4', '2026-01-22 04:30:11.555928+00', 'e19405bf-1f80-4107-af89-084f9ccc5608', '2026-01-25 13:00:00+00', '2a67731a-3aa5-416c-ac11-e4fa364db479', 'failed', NULL, NULL, 'cdbea23e-6767-4722-9319-896fcb6dc057', 'Tanggal 6 Januari 2026, Presiden Prabowo Subianto membuat heboh dengan menggelar ''Briefing Awal Tahun'' yang sangat tidak biasa: mengumpulkan semua menteri dan kepala lembaga di kediaman pribadinya di Hambalang. Ini bukan sidang formal, melainkan retreat santai untuk evaluasi jujur setahun pemerintahan, jauh dari birokrasi istana. Prabowo mendesak peningkatan kinerja, terutama di sektor penciptaan lapangan kerja dan infrastruktur perikanan. Pendekatan kepemimpinan ini viral dan memicu perdebatan: apakah ini inovasi kepemimpinan yang segar (ala team-building korporat) atau hanya sandiwara politik untuk memperketat kendali atas ''Kabinet Merah Putih''? Simbolisme ''kabinet dapur'' ini berhasil mencuri perhatian publik. Menurut Anda, apakah retreat ini terobosan atau gimmick? Tulis pendapat Anda di komentar!', 'instagram', NULL, false, '{"raw":"<html>\r\n<head><title>504 Gateway Time-out</title></head>\r\n<body>\r\n<center><h1>504 Gateway Time-out</h1></center>\r\n<hr><center>nginx/1.29.3</center>\r\n</body>\r\n</html>\r\n"}'::jsonb, 0, NULL, NULL);
